import React from 'react';

function Home() {
    return(
        <div className='home-section'>
            <h3>About us</h3>
            <p>
                Food prices are going up everywhere. It would be nice to know which supermarkets are still reasonably affordable. 
                If you live in lower Manhattan, you can enter your zipcode below and see a list of supermarkets near you sorted by expensiveness: least first, always.
            </p>
        </div>
    )
}

export default Home
